import React from 'react';
import UserInput from '../UserInput/UserInput';
import styles from './UserOutput.module.css';

const UserOutput = props => {
    return (
        <div className={styles.Paragraph}>
            <p>My name is</p>
            <p>And my age is</p>
        </div>
    )
}



export default UserOutput;
